export default function DashboardPage() {
    return (
        <div className="h-screen w-screen bg-[#fbfbfb]">
            <header>
                <div className="max-w-[90%] max-h-[90%] items-center flex justify-center ">
                    <div className="w-full bg-[#fefefe] shadow rounded-lg mt-4 mx-auto py-6  sm:px-6 lg:px-8">
                        <h1 className="text-3xl font-bold font-display text-gray-900">Dashboard</h1>
                    </div>
                </div>
            </header>
        </div>
    )
}
